taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var storeid=  eio.readInt32();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");


//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "([prodName] like '%" + db.encode(searchText) + "%') or " +
        "([manufact] like '%" + db.encode(searchText) + "%') or " + 
        "([produceDate] like '%" + db.encode(searchText) + "%') or " +
        "([validDate] like '%" + db.encode(searchText) + "%') or " +
        "([batch] like '%" + db.encode(searchText) + "%') or " +
        "([sn] like '%" + db.encode(searchText) + "%') or " + 
        "([position] like '%" + db.encode(searchText) + "%') or " + 
        "([codeEpc] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM [unionCode] " +
    "WHERE ([status] <> 'DEL') and (cast(positionId as varchar(15)) = '" + db.encode(storeid) + "') "+  condition 

sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT *,cast((select top 1 (case when temp.temperature is NULL then '' else '<span style=\"color:blue;\">'+ cast(temp.temperature as varchar(100))+'</span>' end) from logTemperature temp where unionCode.codeEpc=temp.codeEpc order by regDatetime desc) as varchar(100)) as temperature FROM unionCode " +
    "WHERE (unionCode.status <> 'DEL') and (cast(positionId as varchar(15)) = '" + db.encode(storeid) + "') "+  condition +
    "ORDER BY unionCode.id DESC ";  
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 


eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"prodName,manufact,produceDate,validDate,batch,sn,codeEpc,temperature,position", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
    return;
}
