if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId")


sql =
    "SELECT top(200) count(*) as c " +
    "FROM logTemperature " +
    "WHERE codeEpc='" +codeEpc+"'";
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT top(200) * " +
    "FROM logTemperature " +
    "WHERE codeEpc='" +codeEpc+"' "+ 
    "order by regDatetime desc ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"regDatetime,deviceId,address,temperature", 0, count);

